let plek_user={construct(){jQuery("#plek-submit").click(function(e){e.preventDefault();let t=jQuery(this).data("type");plek_user.submit(t)})},submit(e){switch(e){case"add_user_account":return void this.add_user_account()}},add_user_account(){plek_main.activate_button_loader("#plek-submit","Erstelle Konto...");let e=jQuery("#plek-submit");jQuery.ajax({url:window.ajaxurl,type:"POST",cache:!1,data:{action:"plek_user_actions",do:"add_user_account",display_name:"",user_name:"",email:""},success:function(t){let a=plek_main.get_text_from_ajax_request(t);plek_main.deactivate_button_loader(e,a),plek_main.deactivate_button(e)},error:function(t){plek_main.deactivate_button_loader(e,"Error loading data.... ")}})}};plek_user.construct();